import React, { useState, useEffect } from "react";
import { Line } from "react-chartjs-2";

function Chart(props) {
  const data = {
    labels: "x",
    datasets: [
      {
        label: "Confirmed",
        data: props.confirmed,
      },
      {
        label: "Deaths",
        data: props.deaths,
      },
    ],
  };

  return <Line data={data} />;
}

export default Chart;
